import React from 'react'

const TopIcons = () => {
  return (
    <div
      style={{
        color: "white",
        //backgroundColor: "black",
        height: "35px",
        display: "flex",
      }}
    >
      <img
        src={"https://pngimg.com/uploads/apple_logo/apple_logo_PNG19677.png"}
        style={{
          width: "20px",
          marginLeft: "4%",
          marginTop: "3.25px",
          height: "24px",
        }}
      />

      <div style={{ marginLeft: "5%", marginTop: "7.5px", fontWeight: "bold"}}>
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "black",
          }}
        >
          F i l e
        </button>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "black",
          }}
        >
          E d i t
        </button>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "black",
          }}
        >
          H e l p
        </button>
      </div>
    </div>
  );
}

export default TopIcons
